/**
 * 860. Lemonade Change
 * https://leetcode.com/problems/lemonade-change/
 *
 * @param {number[]} bills
 * @return {boolean}
 */
const lemonadeChange = function (bills) {
    let cost = 5;
    let cashier = {};
    for (let i = 0; i < bills.length; i++) {
        let bill = bills[i];
        let change = bill - cost;
        if (change > 0) {
            if (!getChange(cashier, change)) {
                return false;
            }
        }
        if (!cashier[bill]) {
            cashier[bill] = 0;
        }
        cashier[bill] += 1;
    }
    return true;
};

/**
 *
 * @param cashier{object}
 * @param change{number}
 * @returns {boolean}
 */
function getChange(cashier, change) {
    const keys = Object.keys(cashier).filter(k => cashier[k] > 0).sort((a, b) => a - b);

    let i = keys.length - 1;
    while (i >= 0 && change >= keys[0]) {
        let bill = keys[i];
        let n = change / bill | 0;
        if (cashier[bill] >= n && change - bill * n >= 0) {
            change -= bill * n;
            cashier[bill] -= n;
        }
        i--;
    }

    return change === 0;
}

